import React from "react";

function home() {
  return (
    <div>
      <div>
        <h1 className="text-left ml-60">Hi There !</h1>
        <h1 className="text-left ml-60 text-3xl">I'm a full stack Developer</h1>
      </div>
    </div>
  );
}

export default home;
